import React from 'react';
import { BrowserRouter,Route,Switch } from "react-router-dom";
import PhotoList from "./pages/photoList.js";

function App () {
  return (
    <BrowserRouter>
    <Switch>
      <Route path="/">
        <PhotoList />
      </Route>
    </Switch>
    </BrowserRouter>
  );
}


export default App;
